  03> WHITE, Melanie Lisa and ROPER, Adrian Richard
  b 31.05.1965
  b 20.08.1964
  Melanie b. at Auckland. Adrian b. at Chapel Hill, North Carolina, USA. Address: 16
  Howe Street, New Brighton, Christchurch.
  Melanie was educated at Campbell's Bay School and Rangitoto College, Auckland. She
  has worked as a ski teacher (1984-87), ski patrol (1987-89) was windsurfing in Maui
  (1989-91) and has completed at BA degree at Lincoln University. She now does
  contract work for Coast Care, Christchurch. Her interests include music, animals,
  environmental concerns and sports.
  Adrian has his own business designing, manufacturing and selling windsurfers.
  01> ROPER, Lucy Marilyn White
  b 20.10.1996
  03>'LUDBROOK, Doris Gwyneth m on 15.08.1964 to WILLIAMS, Gordon Stewart
  b 29.12.1933
  b 15.08.1933
  Gwyneth b. at Pakaraka and m. at St George's Anglican Church, Epsom, Auckland.
  Gordon, slo Henry Stewart Williams (of England) and Winifred Maysel Annette
  Lynd Taylor (of Port Chalmers), b. at Enfield, England. Address: 26 Masefield
  Street, Howick, Auckland; Email: gorswill@ihug.co.nz.
  Gwyneth was educated at Epsom Girls' Grammar School and qualified as a medical
  technologist in 1957. She has worked at diagnostic laboratories for over 25
  years.
  Gordon was educated at St Edmund's, Canterbury, England. He completed a motor trade apprenticeship in
  the UK and gained trade certification as an autopartsman in New Zealand. He worked in the motor and
  engineering trades until his retirement in 1992.
  Gwyneth enjoys gardening and Gordon has interests in miniature radio-controlled aviation and computing.
  He has served on the committee of the Amiga Auckland Computer User's Group. They both enjoy choral
  singing. Gwyneth was a member of the Auckland Choral Society for many years and they now belong to the
  Pakuranga Choral Society where Gordon is a committee member.
  01> WILLIAMS, Michael Stewart m on 20.01.1996 to MARRAN, Rosamunde
  b 03.02.1966
  b 17.12.1975
  Michael b. at Auckland and m. at All Saints Anglican Church, Howick,
  Auckland, Rosamunde, d/o Brian Marran and Dallas Erica Kingham, b. at
  Surrey, England. Address: 22 Masefield Street, Howick, Auckland.
  Michael was educated at Edgewater College and qualified as a chartered
  accountant in public practice in Auckland before spending five years
  working in England and Scotland and travelling through Europe. He met
  Rosamunde in London and returned with her to New Zealand in 1995.
  Rosamunde's parents are both from South Africa. She was brought up in Launceston, Cornwall, and
  was educated at St Joseph's Convent School and Launceston College. She spent time in Bournemouth,
  London and South Africa before returning to London (shortly after Michael visited South Africa) and
  becoming engaged.
